import React, { Component } from 'react'
import { VictoryPie, VictoryTooltip, VictoryLabel, CustomLabel } from 'victory'

export class Circle extends Component {
    render() {
        return (
            <div>
            <VictoryPie
                data={[
                    { x: "Cats", y: 35 },
                    { x: "Dogs", y: 40 },
                    { x: "Birds", y: 55 }
                ]}
            />

            </div>
        )
    }
}

export default Circle
